import './Adapter.css';
import ButtonImage from "../button_img/ButtonImage.js";

export default function Adapter() {
  fetch('http://localhost:5000/adapter', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({ask:"adapter800"})
  })
    .then(response => response.json())

  return (
    <div className="App">
      <header className="App-title">Ethernet Network Adapter</header>
      <div className="App-header">
        <ButtonImage img_path="./menu_img/nic.png" site="/adapter/800" name="800 Series" />
        <ButtonImage img_path="./menu_img/nic.png" site="/adapter/700" name="700 Series" />
        <ButtonImage img_path="./menu_img/nic.png" site="https://google.com" name="600 Series" />
        <ButtonImage img_path="./menu_img/nic.png" site="https://google.com" name="500 Series" />
        <ButtonImage img_path="./menu_img/nic.png" site="https://google.com" name="300 Series" />
        <ButtonImage img_path="./menu_img/nic.png" site="https://google.com" name="200 Series" />
        <ButtonImage img_path="./menu_img/nic.png" site="https://google.com" name="Legacy" />
        <ButtonImage img_path="./menu_img/nic.png" site="https://google.com" name="VMC" />
      </div>
    </div>
  );

}
